#include <iostream>
#include <vector>

using namespace std;

class Vector {
public:

    Vector() : arr_(new int[4]), size_(0), capacity_(4) {}


    Vector(const int new_capacity) : arr_(new int[new_capacity]), size_(0), capacity_(new_capacity) {}

    Vector(const Vector& other) : arr_(new int[other.capacity_]), size_(other.size_), capacity_(other.capacity_) {
        for (int i = 0; i < size_; i++) {
            arr_[i] = other.arr_[i];
        }
        total_number_elements_ += size_;
    }

    void push_back(const int value) {
        check_capacity_();
        arr_[size_] = value;
        size_++;
        total_number_elements_++;
    }

    void insert(const int index, const int value) {
        if (index < 0 || index >= size_) {
            cout << "Invalid index" << endl;
            return;
        }
        check_capacity_();
        for (int i = size_; i > index; i--) {
            arr_[i] = arr_[i - 1];
        }
        arr_[index] = value;
        size_++;
        total_number_elements_++;
    }

    void erase(const int index) {
        if (index < 0 || index >= size_) {
            cout << "Invalid index" << endl;
            return;
        }
        for (int i = index; i < size_ - 1; i++) {
            arr_[i] = arr_[i + 1];
        }
        size_--;
        total_number_elements_--;
    }

    int get_value(const int index) {
        if (index >= 0 && index < size_) {
            return arr_[index];
        }
    }

    void set_value(const int index, const int value) {
        if (index < 0 || index >= size_) {
            cout << "Invalid index" << endl;
            return;
        }
        arr_[index] = value;
    }

    void pop_back() {
        size_--;
        total_number_elements_--;
    }

    void print() {
        for (int i = 0; i < size_; i++) {
            cout << arr_[i] << " ";
        }
        cout << endl;
    }

    int size() {
        return size_;
    }

    int capacity() {
        return capacity_;
    }

    ~Vector() {
        delete[] arr_;
        total_number_elements_ -= size_;
    }

    static int get_total_number_elements() {
        return total_number_elements_;
    }

private:
    int* arr_; // массив для хранения элементов
